**React App**

```jsx
import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [data, setData] = useState([]);
  const [name, setName] = useState('');
  const [age, setAge] = useState('');

  useEffect(() => {
    axios.get('/api/data')
      .then(response => {
        setData(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  const handleSubmit = (event) => {
    event.preventDefault();
    axios.post('/api/data', { name, age })
      .then(response => {
        setData([...data, response.data]);
        setName('');
        setAge('');
      })
      .catch(error => {
        console.error(error);
      });
  };

  return (
    <div>
      <h1>Data</h1>
      <ul>
        {data.map(item => (
          <li key={item.id}>{item.name} - {item.age}</li>
        ))}
      </ul>
      <form onSubmit={handleSubmit}>
        <input type="text" value={name} onChange={(event) => setName(event.target.value)} placeholder="Name" />
        <input type="number" value={age} onChange={(event) => setAge(event.target.value)} placeholder="Age" />
        <button type="submit">Add</button>
      </form>
    </div>
  );
}

export default App;
```

**Node.js and Express.js Server**

```javascript
const express = require('express');
const app = express();
const port = 3001;

app.use(express.json());

let data = [
  { id: 1, name: 'John Doe', age: 30 },
  { id: 2, name: 'Jane Doe', age: 25 },
];

app.get('/api/data', (req, res) => {
  res.json(data);
});

app.post('/api/data', (req, res) => {
  const { name, age } = req.body;
  const newItem = { id: data.length + 1, name, age };
  data.push(newItem);
  res.json(newItem);
});

app.listen(port, () => {
  console.log(`Server started on port ${port}`);
});
```

**How to deploy the code after creating a build**

To deploy your React app with a Node.js and Express.js server, you'll need to create a production build of your React app and then deploy both the React app and the Node.js server to a hosting platform. Here's a step-by-step guide:

**Step 1: Create a production build of your React app**

Run the following command in your terminal:
```bash
npm run build
```
This will create a `build` folder in your React app directory, which contains the production-ready code.

**Step 2: Deploy your React app**

You can deploy your React app to a hosting platform like Vercel, Netlify, or GitHub Pages. Here, we'll use Vercel as an example.

Create a Vercel account and install the Vercel CLI using npm:
```bash
npm install -g vercel
```
Then, run the following command to deploy your React app:
```bash
vercel build
```
Follow the prompts to set up your Vercel project.

